// 获取所有题目
function getAllProblems() {
    return problems;
}

// 根据ID获取题目
function getProblemById(id) {
    return problems.find(p => p.id === id);
}

// 根据难度获取题目
function getProblemsByDifficulty(difficulty) {
    return problems.filter(p => p.difficulty === difficulty);
}

// 根据分类获取题目
function getProblemsByCategory(category) {
    return problems.filter(p => p.category === category);
}

// 获取题目总数
function getTotalProblems() {
    return problems.length;
}

// 获取所有可用的分类
function getAvailableCategories() {
    return Object.values(CATEGORIES);
}

// 获取所有可用的难度等级
function getAvailableDifficulties() {
    return Object.values(DIFFICULTIES);
}

// 根据多个条件筛选题目
function filterProblems({ categories = [], difficulties = [], page = 1, pageSize = 10 } = {}) {
    let filteredProblems = problems;
    
    // 应用分类过滤
    if (categories.length > 0) {
        filteredProblems = filteredProblems.filter(p => categories.includes(p.category));
    }
    
    // 应用难度过滤
    if (difficulties.length > 0) {
        filteredProblems = filteredProblems.filter(p => difficulties.includes(p.difficulty));
    }
    
    // 计算分页
    const totalItems = filteredProblems.length;
    const totalPages = Math.ceil(totalItems / pageSize);
    const startIndex = (page - 1) * pageSize;
    const endIndex = startIndex + pageSize;
    
    return {
        problems: filteredProblems.slice(startIndex, endIndex),
        pagination: {
            currentPage: page,
            pageSize,
            totalItems,
            totalPages
        }
    };
}

// 随机获取指定难度和分类的题目
function getRandomProblem({ categories = [], difficulties = [] } = {}) {
    const filtered = filterProblems({ categories, difficulties }).problems;
    if (filtered.length === 0) return null;
    const randomIndex = Math.floor(Math.random() * filtered.length);
    return filtered[randomIndex];
}

